var years = [1986, 1987, 1988, 1989, 1990, 1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999, 2000, 2001, 2002, 2005, 2006, 2007, 2008, 2009, 2010, 2011, 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021, 2022, 2023, 2024];
var currentYearIndex = 0;
var isPlaying = true;
var previousMarkers = [];
var currentMarkers = [];

function clearMarkers() {
    previousMarkers.forEach(marker => marker.remove());
    currentMarkers.forEach(marker => marker.remove());
    previousMarkers = [];
    currentMarkers = [];
}

function showYear(yearIndex) {
    clearMarkers();
    var year = years[yearIndex];
    var data = yearData[year];

    document.getElementById('current-year').textContent = year;
    document.getElementById('case-count').textContent = data.current.length;

    data.previous.forEach(point => {
        var marker = L.circleMarker([point.lat, point.lon], {
            radius: 5,
            fillColor: '#888888',
            color: '#666666',
            weight: 1,
            opacity: 0.6,
            fillOpacity: 0.4
        }).addTo(map_a8ecae7600cf903e661526caaf741669);
        previousMarkers.push(marker);
    });

    data.current.forEach(point => {
        var marker = L.circleMarker([point.lat, point.lon], {
            radius: 8,
            fillColor: '#ff0000',
            color: '#8B0000',
            weight: 2,
            opacity: 1,
            fillOpacity: 0.8
        }).addTo(map_a8ecae7600cf903e661526caaf741669);

        marker.bindPopup('<b>Year:</b> ' + year + '<br><b>Species:</b> ' + point.species + '<br><b>Date:</b> ' + point.date);
        currentMarkers.push(marker);
    });
}

function nextYear() {
    currentYearIndex = (currentYearIndex + 1) % years.length;
    showYear(currentYearIndex);
}

function togglePlayPause() {
    isPlaying = !isPlaying;
    document.getElementById('play-pause-btn').textContent = isPlaying ? 'Pause' : 'Play';
    document.getElementById('play-pause-btn').style.background = isPlaying ? '#4CAF50' : '#FF9800';
}

function restart() {
    currentYearIndex = 0;
    showYear(currentYearIndex);
    if (!isPlaying) togglePlayPause();
}

document.getElementById('play-pause-btn').addEventListener('click', togglePlayPause);
document.getElementById('restart-btn').addEventListener('click', restart);

setInterval(function() {
    if (isPlaying) {
        nextYear();
    }
}, 1500);

showYear(0);
</script>
